import React from "react";
import { styled } from "styled-components";

const GNBWrap = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 70px;
  border-bottom: 1px solid #000;
  background-color: #090b13;
  display: flex;
  justify-contents: space-between;
  padding: 0 36px;
`;

const GNB = () => {
  return <GNBWrap>GNB</GNBWrap>;
};

export default GNB;
